import Article from './Component/LatestArticle.jsx/Aarticle';
import MainArticle from './Component/LatestArticle.jsx/MainArticle/MainArticle';
import RightComp from './Component/LatestArticle.jsx/ArticleRightComp/Rightcomp';

function App() {
  return (
  <div className='App'> 
  <Header/>
  <Home/> 
  <Latest/>
  <MainArticle/>
  <Rightcomp/>
  </div>
  )
}

export default App;
